def main():
    runs = int(os.environ.get('BENCH_RUNS', '2'))
    timings = []
    for _ in range(runs):
        elapsed, count, total_bytes, digest = time_scan_and_hash()
        timings.append(elapsed)
        print(f"scan: {elapsed:.4f}s files={count} bytes={total_bytes} digest={digest}")
